import React from "react";
import { useEffect, useState } from "react";
import axios from "axios";

const Data = (props) => {
  const [latestBlock, setlatestBlock] = useState(null);

  let headers = new Headers();

  const testGetFun = () => {
    let url = "https://blockchain.info/latestblock";
    return async () => {
      fetch(url, {
        headers: {
          mode: "no-cors",
          "Access-Control-Allow-Origin": "*",
          "Access-Control-Allow-Headers":"*",
          "Access-Control-Request-Method":"GET"
        },
      })
        .then((response) => response.json())
        .then((data) => console.log(data));
    };
  };

  const getLatestBlock = () => {
    return async () => {
      let res = await axios.get(`https://blockchain.info/latestblock`, {
        //   headers:{"Access-Control-Allow-Origin":"*",
        //   'Content-Type': 'application/json',
        // }
        headers: {
          "Access-Control-Allow-Origin": "*",
          "Content-Type": "application/x-www-form-urlencoded; charset=UTF-8",
          "Access-Control-Allow-Headers":
            "X-API-KEY, Origin, X-Requested-With, Content-Type, Accept, Access-Control-Request-Method,Access-Control-Request-Headers, Authorization",
        },
      });
      console.log("Getting the data");
      // console.log(res.data);
      console.log(res.json());
    };
  };
  useEffect(testGetFun());
  return (
    <>
      <h1>This is Data page</h1>
    </>
  );
};

export default Data;
